@Override
public boolean equals(Object obj) {
    if (obj == this) {
        return true;
    }
    if (!(obj instanceof Series)) {
        return false;
    }
    Series that = (Series) obj;
    if (!Objects.equals(this.key, that.key)) {
        return false;
    }
    if (!Objects.equals(this.description, that.description)) {
        return false;
    }
    if (!that.canEqual(this)) {
        return false;
    }
    return true;
}

